import React from 'react';

import Title from '../components/title.js';

import './welcome.css';

export class Welcome extends React.Component {
    constructor (props){
        super(props);
    }
    render(){
        return (
        <div className='container'>
            <div className="title"><a href="/quiz"><Title /></a></div>
        </div>
        )}
}
